import React from "react";
import Map from "./Map";
import TopNavbar from "./TopNavbar";

export default class MyComponent extends React.Component {

	render() {
		return (				
				<Container>
				<Row>
					<Col><TopNavbar/></Col>
				</Row>
				<Row>
					<Col>1 of 3</Col>
					<Col><Map/></Col>
				</Row>
				</Container>
		);
	}
}
